const inititalState = {
  counter: 0,
};

const RootReducer = (state = inititalState, action) => {
  switch (action.type) {
    case "INCREMENT":
      return (counter = state.counter + 1);
    case "DECREMENT":
      return (counter = state.counter - 1);
  }
};

export default RootReducer;
